	(5, 'gfhgfh dfhd ', '<p>dh dh</p>', 'gfhgfh-dfhd', '<p>Rynek, nieruchomości, szczg&oacute;lnie luksusowych apartamentowc&oacute;w, hoteli czy condohoteli, od lat cieszy się niesłabnącym zainteresowaniem inwestor&oacute;w.</p>\r\n<p><br /> Do tej pory jednak barierą wejścia były znaczne środki, jakie trzeba było posiadać, by<br /> rozpocząć inwestowaniw. Rozw&oacute;j technologii bloc chain i opartej na niej tokenizacji<br /> nieruchomości otwiera jednak całkiem nowe możliwości na tym polu.</p>\r\n<p>&nbsp;</p>', 'pl', '2019-07-26 20:31:10', '2021-02-10 20:20:09', '', '', '', 'active', 1, 1, NULL, 1, 20, 3, 0, '', ''),
