	(9, 'sdfsd', '<p>asdf asd fsd fasd&nbsp;</p>\r\n<p>&nbsp;asdf ad f</p>\r\n<p>&nbsp;</p>', 'sdfsd', '', 'pl', '2020-09-23 22:10:13', '2020-12-23 21:08:56', '', '', '', 'active', 1, 1, NULL, NULL, NULL, NULL, 0, '', 'gallery'),
	(10, 'Nowa sieć gastronomiczna FAST FOOD', '<h3 class="Header-icon">Analiza rynku<img class="Header-icon__icon" src="http://localhost:63342/nol/work/NOL/svg/znaczek.svg" alt="" /></h3>\r\n<h6 class="O-projekcie__desc O-projekcie__desc--black">Rynek HoReCa w Polsce jest wart blisko 33,1 mld zł, a jego wartość wzrosła w 2019 r. o 7%. Ponad 59% os&oacute;b najchętniej odwiedza lokale typu fast food. Z kolei wśr&oacute;d najważniejszych czynnik&oacute;w zachęcających do powrotu do lokalu gastronomicznego wymieniono smak potraw, ceny, lokalizację oraz wystr&oacute;j/klimat lokalu. Potwierdza to, iż intrygujący wyglądem lokal oferujące dania fast food w przystępnej cenie wpisuje się w schemat najchętniej odwiedzanego lokalu gastronomicznego przez konsument&oacute;w w Polsce.</h6>\r\n<p class="O-projekcie__text">Dodatkowo przeprowadzono ocenę konceptu NOL Restaurant. Na pytanie &bdquo;Czy udałby/aby się Pan/i do zaprezentowanej restauracji?&rdquo;, 81,7% badanych odpowiedziało tak, uzasadniając iż powodem jest ciekawy i oryginalny wygląd oraz ciekawość.</p>\r\n<h3 class="Header-icon"><img class="O-projekcie__img" src="http://localhost:63342/nol/work/NOL/img/img_1.png" alt="" />&nbsp;<img class="O-projekcie__img" src="http://localhost:63342/nol/work/NOL/img/img_2.png" alt="" /><img src="http://local.nol/storage/files/5f76334797d8fblobid1601581886933.png" alt="" width="2830" height="1092" /></h3>\r\n<h3 class="Header-icon"><img src="http://local.nol/storage/files/5f763530dc214blobid1601582383386.png" alt="" width="1998" height="888" /></h3>\r\n<h3 class="Header-icon">Programy finansowe<img class="Header-icon__icon" src="http://localhost:63342/nol/work/NOL/svg/znaczek.svg" alt="" /></h3>\r\n<div class="Table__header">Prognozy dotyczą jednej restauracji, w tyś. złotych</div>\r\n<div class="table-responsive">\r\n<table class="Table table table-bordered text-center">\r\n<thead>\r\n<tr>\r\n<th scope="col">-</th>\r\n<th scope="col">1 rok</th>\r\n<th scope="col">2 rok</th>\r\n<th scope="col">3 rok</th>\r\n<th scope="col">4 rok</th>\r\n<th scope="col">5 rok</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Przychody</td>\r\n<td>3 676,5</td>\r\n<td>4 644,0</td>\r\n<td>4 644,0</td>\r\n<td>4 644,0</td>\r\n<td>4 644,0</td>\r\n</tr>\r\n<tr>\r\n<td>KOSZTY</td>\r\n<td>2 331,3</td>\r\n<td>2 589,1</td>\r\n<td>2 589,1</td>\r\n<td>2 589,1</td>\r\n<td>2 589,1</td>\r\n</tr>\r\n<tr>\r\n<td>EBIT</td>\r\n<td>1 345,2</td>\r\n<td>2 054,9</td>\r\n<td>2 054,9</td>\r\n<td>2 054,9</td>\r\n<td>2 054,9</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class="Table__header">Oczekiwania inwestycyjne (w tyś. zł)</div>\r\n<div class="table-responsive">\r\n<table class="Table Table--reversed table table-bordered">\r\n<tbody>\r\n<tr>\r\n<td>Całkowita kwota inwestycji</td>\r\n<td class="text-center no-wrap">3 000,0</td>\r\n</tr>\r\n<tr>\r\n<td>Koszty budowy nieruchomości wraz z zagospodarowaniem terenu</td>\r\n<td class="text-center no-wrap">2 279,0</td>\r\n</tr>\r\n<tr>\r\n<td>Koszty wyposażenia i montażu oraz pozostałe koszty przygotowawcze</td>\r\n<td class="text-center no-wrap">435,6</td>\r\n</tr>\r\n<tr>\r\n<td>Rezerwa budżetowa</td>\r\n<td class="text-center no-wrap">284,6</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<section class="Section Analize animatedParent">\r\n<div class="container fadeIn animated go">\r\n<h3 class="Header-icon">Dokumenty do pobrania<img class="Header-icon__icon" src="http://localhost:63342/nol/work/NOL/svg/znaczek.svg" alt="" /></h3>\r\n<div class="Doc">\r\n<div>Analiza finansowa na rok 2020 / PDF /</div>\r\n<a class="btn btn-gray" href="http://localhost:63342/nol/work/NOL/o-projekcie.html?_ijt=obbrqo6hp8oqutv9o1bh9bnqnh">Pobierz plik</a></div>\r\n<div class="Doc">\r\n<div>Regulamin użytkowania token&oacute;w / DOC /</div>\r\n<a class="btn btn-gray" href="http://localhost:63342/nol/work/NOL/o-projekcie.html?_ijt=obbrqo6hp8oqutv9o1bh9bnqnh">Pobierz plik</a></div>\r\n<div class="Doc">\r\n<div>Prognozy finansowe na lata 2020 - 2022 / PDF /</div>\r\n<a class="btn btn-gray" href="http://localhost:63342/nol/work/NOL/o-projekcie.html?_ijt=obbrqo6hp8oqutv9o1bh9bnqnh">Pobierz plik</a></div>\r\n</div>\r\n</section>\r\n</div>', 'nowa-sie-gastronomiczna-fast-food', '<h3 class="O-projekcie__sub-header">Powstał projekt nowej sieci gastronomicznej.</h3>\r\n<h6 class="O-projekcie__desc">Jego pomysłodawcy chcą stworzyć sieć innowacyjnych lokali typu fast-food, pod nazwą NOL Restaurant.<br />Restauracja będzie swoim wyglądem przypominała "latający spodek".</h6>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'pl', '2020-10-01 21:28:33', '2020-10-02 22:44:07', '', '', '', 'active', 1, 1, NULL, 4, NULL, NULL, 0, '', '');
