	(146, 'footer cookie pl', NULL, '<p>\r\n                            Serwis wykorzystuje pliki cookies. Korzystając ze strony\r\n                            wyrażasz zgodę na wykorzystywanie plików cookies.\r\n                            <a class="Cookies__more-btn" href="#">Dowiedz się więcej</a>\r\n                        </p>', 'system'),
	(147, 'footer copyright 1pl', NULL, 'Wszelkie prawa zastrzeżone &#169; 2020 NOL restaurant\r\n                            &nbsp;|&nbsp;\r\n                            <a class="Footer__link" href="">Regulamin</a> &nbsp;|&nbsp;\r\n                            <a class="Footer__link" href="">Polityka&nbsp;prywatności</a>', 'system'),
	(148, 'footer copyright 2pl', NULL, 'Realizacja\r\n                            <a\r\n                                    class="Footer__link"\r\n                                    target="_blank"\r\n                                    href="https://www.vertesdesign.pl/"\r\n                            >Vertes Desing</a>', 'system'),
	(149, 'home - roadmap - text', 'Sprawdź kolejność wydarzeń jakie mają miejsce przy NOL\r\n                        restaurant. Informujemy o wszystkich kluczowych wydarzeniach\r\n                        abyście Państwo byli na bieżąco.', NULL, 'text'),
	(150, 'home - filmy youtube', 'https://www.youtube.com/embed/ScMzIvxBSi4,https://www.youtube.com/embed/ScMzIvxBSi4,https://www.youtube.com/embed/ScMzIvxBSi4', NULL, 'system'),
	(151, 'Home section 1 - title 1 pl', 'Nowa sieć gastronomiczna', NULL, 'text'),
	(152, 'Home section 1 - title 2 pl', 'FAST FOOD', NULL, 'text'),
	(153, 'Home section 1 - title 3 pl', 'Powstał projekt nowej sieci gastronomicznej. Jego pomysłodawcy\r\n                        chcą stworzyć sieć innowacyjnych lokali typu fast-food, pod\r\n                        nazwą NOL Restaurant. Restauracja będzie swoim wyglądem\r\n                        przypominała "latający spodek".', NULL, 'text'),
	(154, 'Home section 1 - 2 title pl', 'Innowacyjna Restauracja', NULL, 'text'),
	(155, 'Home section 1 - 2 text pl', 'Przedmiotem niniejszego przedsięwzięcia jest utworzenie\r\n                            innowacyjnej restauracji typu fast-food, która będzie swoim\r\n                            wyglądem przypominała „latający spodek” (NOL, czyli\r\n                            Niezidentyfikowany Obiekt Latający). Restauracja będzie\r\n                            oferowała dania kuchni północnoamerykańskiej z elementami\r\n                            kuchni greckiej i meksykańskiej (dania będą dostosowane do\r\n                            pory dnia). Restauracja będzie również oferować dania "na\r\n                            wynos".', NULL, 'text'),
	(156, 'Home section 1 - 3 title pl', 'Edukacja-<br/>rozrywka', NULL, 'text'),
	(157, 'Home section 1 - 3 text pl', 'Uzupełnieniem restauracji NOL Restaurant będzie ścieżka\r\n                            edukacyjno-rozrywkowa o tematyce planetarnej. Po obwodzie\r\n                            spotka na długości 84 metrów zostanie stworzona edukacyjna\r\n                            ścieżka układu słonecznego. Obiekt będzie miał na celu w\r\n                            nowoczesny sposób nauczać astronomii. W tym celu zostaną\r\n                            wykorzystane makiety planet, wizualizacje tworzone przez\r\n                            projektory, światła i lasery, stanowiska do projekcji VR.', NULL, 'text'),
	(158, 'home section 1 - image 1', '/img/_MG_0022.jpg', NULL, 'system'),
	(159, 'Home section 1 - 4 title pl', 'Budowa', NULL, 'text'),
	(160, 'Home section 1 - 4 text pl', 'Restauracja zostanie w całości zbudowana ze stali, zaś\r\n                            zewnętrzna obudowa zostanie wykonana z blachy ocynkowanej.\r\n                            Obiekt, o średnicy 27 metrów i wysokości 12 metrów, będzie\r\n                            składał się z dwóch poziomów, a w tym sali głównej oraz\r\n                            antresoli. Po zachodzie słońca cała bryła obiektu będzie\r\n                            oświetlana za pomocą reflektorów umieszczonych na obiekcie,\r\n                            jak i wokół niego. Ze względu na niespotykaną konstrukcję oraz\r\n                            ścieżkę edukacyjno-rozrywkową, obiekt będzie atrakcją\r\n                            turystyczną w danym regionie.', NULL, 'text'),
	(161, 'home section 1 - image 2', '/img/n3.jpg', NULL, 'system'),
	(162, 'Home section 1 - 5 title pl', 'Lokalizacja', NULL, 'text'),
	(163, 'Home section 1 - 5 text pl', 'Ze względu na charakter restauracji idealna lokalizacja to\r\n                            działka umiejscowiona przy drodze szybkiego ruchu na obrzeżach\r\n                            dużego miasta, gdzie występuje duże natężenie ruchu, a\r\n                            kierowcy i podróżni chcą odpocząć i zjeść szybki posiłek.\r\n                            Zapewni to optymalne wykorzystanie zasobów obiektu oraz\r\n                            realizację przyjętych założeń sprzedażowych. Po sfinalizowaniu\r\n                            założonego celu, czyli otwarciu pierwszej restauracji NOL\r\n                            Restaurant, spółka wybuduje kolejne obiekty, przy najbardziej\r\n                            ruchliwych szlakach komunikacyjnych w Polsce (16 obiektów po\r\n                            jednym na każde województwo).', NULL, 'text'),
